import { Card, CardActionArea, CardContent, Typography } from "@mui/material";

const Cards = () => {
    return (
        <Card sx={{ maxWidth: 400}}>
            <CardActionArea>
                <CardContent>
                    <Typography gutterBottom variant="h5" component={"div"}>
                        PostgreSQL
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                        Click this card to go the PostgreSQL UI for creating, reading, 
                        uploading, and destroying items on the DB. 
                    </Typography>
                </CardContent>
            </CardActionArea>
        </Card>
    )
}

export default Cards;
